    "Prediction intervals show that the regression model for CRU predicts all costs for 20000 units are \\$46268.7 to $59296.\n",
    "The regression model for TOI predicts all costs for 20000 units are \\$58074.29 to $69141.98. There is only slight overlap between CRU and TOI.\n"
